import React, {useState} from 'react';
import './Home.css';
import ItemList from './components/itemList';
import Navbar from './components/Navbar/Navbar';
import Cart from './components/Cart/cart';
class Home extends React.Component<{}, {}> {
  public render() {

    return (
      <div className="Home">
        <Cart/>
         <Navbar/>
        <ItemList/>
      </div>
    );
  }
}

export default Home;
